query:
-- Check islands with guides
SELECT COUNT(*) as islands_with_guides FROM places p
WHERE p.type = 'island' AND EXISTS (
  SELECT 1 FROM island_guides ig WHERE ig.placeId = p.id
);

-- Check islands without guides
SELECT COUNT(*) as islands_without_guides FROM places p
WHERE p.type = 'island' AND NOT EXISTS (
  SELECT 1 FROM island_guides ig WHERE ig.placeId = p.id
);

-- Sample islands without guides
SELECT p.id, p.name, p.slug FROM places p
WHERE p.type = 'island' AND NOT EXISTS (
  SELECT 1 FROM island_guides ig WHERE ig.placeId = p.id
)
LIMIT 10;

